<SCRIPT>

// Eostre Egg

var cells = new Array()

window.onload = beginInvert;

function beginInvert()
{
	var count = document.all.tags("TD").length

	for(var index=0; index < count; index++)
	{
		cells[index] = index;
	}

	window.setTimeout("invert()", 0);
}
function invert()
{
	var index = Math.floor(Math.random() * cells.length);
	
	var TD = document.all.tags("TD")[cells[index]];
	
	TD.bgColor = inverse(TD.bgColor);

	cells.splice(index, 1);
			
	if(cells.length != 0)
	{
		window.setTimeout("invert()", 0);
	}
}
function inverse(color)
{
	if(color.length == 7)
	{
		color = color.substring(1, 7);
	}

	color = "00000" + (0xffffff - parseInt(color, 16)).toString(16);

	return color.substr(color.length - 6, 6);
}
</SCRIPT>
